import React, { useEffect, useState } from 'react'
import { Link } from 'react-router-dom'
import { content } from '../../Utils/Constants';

const NotFoundPage = () => {

  const accessToken = localStorage.getItem(content.ACCESS_TOKEN);
  const isLoggedIn = !!accessToken;
  const [isAuthenticated, setIsAuthenticated] = useState(!isLoggedIn)

  useEffect(() => {
    if (isAuthenticated !== null) {
      setIsAuthenticated(isAuthenticated)
    } else {
      setIsAuthenticated(false)
    }
  }, [isAuthenticated])

  return (
    <div className='page_not_round'>
      {!isAuthenticated ? (
        <>
          <h1>You have already Logged in</h1>
          <Link to="/dashboard">Please go to Dashboard</Link>
        </>
      ) : (
        <>
          <h1>You are not Logged in</h1>
          <Link to="/login">Please Login to continue</Link>
        </>
      )}
    </div>
  )
}

export default NotFoundPage
